import { Statistic, Card, Row, Col } from "antd";
import "../CustomCSS.css";
function StatisticsBoxes() {
  return (
    <div className="site-statistic-demo-card">
      <Row gutter={25}>
        <Col span={6}>
          <Card
            bodyStyle={{ background: "#1F1E26" }}
            style={{ height: "10px" }}
          >
            <Statistic
              title="Active"
              value={11.28}
              valueStyle={{ color: "white" }}
              height={10}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card bodyStyle={{ background: "#1F1E26" }}>
            <Statistic
              title="Active"
              value={11.28}
              valueStyle={{ color: "white" }}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card bodyStyle={{ background: "#1F1E26" }}>
            <Statistic
              title="Active"
              value={11.28}
              valueStyle={{ color: "white" }}
            />
          </Card>
        </Col>
        <Col span={6}>
          <Card bodyStyle={{ background: "#1F1E26" }}>
            <Statistic
              title="Active"
              value={11.28}
              valueStyle={{ color: "white" }}
            />
          </Card>
        </Col>
      </Row>
    </div>
  );
}

export default StatisticsBoxes;
